import React, { useEffect, useState } from 'react';

export default function TrendingPage() {
  const [trendData, setTrendData] = useState(null);

  useEffect(() => {
    // Contoh fetch data tren (ubah sesuai API atau sumber data Anda)
    fetch('http://localhost:5003/api/trending')  // Sesuaikan URL API tren
      .then(res => res.json())
      .then(data => setTrendData(data))
      .catch(err => console.error('Gagal memuat data tren:', err));
  }, []);

  return (
    <div className="app-container">
      <h2 style={{ color: '#ec407a', textAlign: 'center', marginBottom: 30 }}>
        Tren Pencarian Pekerjaan
      </h2>
      {trendData ? (
        <div>
          {/* Tempatkan grafik tren disini */}
          {/* Contoh jika menggunakan Chart.js atau library lain */}
          {/* Anda bisa render chart sesuai data */}
          <pre>{JSON.stringify(trendData, null, 2)}</pre>
        </div>
      ) : (
        <p style={{ textAlign: 'center' }}>Memuat data tren...</p>
      )}
    </div>
  );
}
